                status: "Redhead girl",
                location:
                    {
                        city: 'Wroclaw',
                        country: 'Poland',

                    },
            },
            {
                id: 3,
                followed: false,
                fullName: 'Aneta Snihur',
                status: "Manchester City Fan №1",
                location:
                    {
                        city: 'Wroclaw',
                        country: 'Poland',

                    },
            },
    ]
}

const UsersReducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state;
    }
}
export const followAC = () => ({type: FOLLOW});
export const unfollowAC = () => ({type: UNFOLLOW})


export default UsersReducer;
